import "../styles/navbar.css";
const Navbars = () => (
    <div className="">
        <div className="">
          
            <MyNav address="/" isExact={true} label="سالیاس"/>
            <Link href="/"> <img alt="logo" src="/assert/logo.png" className="navbar-logo"/></Link>
        </div>
</div>
);
export default Navbars;
